<p><span style="color: #e03e2d;">如果您是不 满十四周岁的儿童，请通知您的监护人共同阅读本《隐私政策》，并在您提 交个人信息、使用米哈游服务之前，寻求并取得您的监护人的同意和指导。 您点击同意本《隐私政策》，或者您使用/继续使用米哈游服务、提交个人信 息，都表示您已获得您的监护人的许可，且您的监护人亦同意受本《隐私政 策》。 </span></p>
